  station data from CTD casts from the GALLATIN from Ocean Weather Station B (OWS-B)
  in the North Atlantic Ocean 14 October 1970 to 16 November 1970 (NODC Accession
  7100643)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
